description:
Welcome to the Killzone. In the not-too-distant future, humanity is colonizing the Milky Way galaxy. As this human empire spreads, a splinter group calling themselves the Helghast launch an offensive against loyal ISA commando forces. Killzone is a first-person shooter that puts you in the middle of a &quot;killzone,&quot; with the Helghast pinning your squad down in an urban trap. Slowly, you will squeeze your way out, returning fire in an exciting cat-and-mouse game of survival, taking you across a world scarred by intergalactic warfare.


